const CareerRow = (props) => {

    return(
        <>
        <tr key={e.id}>
                <td>
                  <input
                    type="checkbox"
                    checked={checkedRowId.includes(e.id)}
                    onChange={() => {
                      onSelect(e.id);
                    }}
                  />
                </td>
                <td>{e.company}</td>
                <td>{e.position}</td>
                <td>
                  {e.start_date}-{e.end_date}
                </td>
                <td
                  onClick={() => onDeleteRow(e.id)}
                  style={{
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    cursor: 'pointer',
                  }}
                >
                  <DeleteOutlineIcon />
                </td>
              </tr>
        </>
    )
};

export default CareerRow;
